script: |
  super -f text -I q10451.spq | sort > q10451.out

inputs:
  - name: q10451.spq
    data: |
      SELECT ALL col1 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 < NULL OR NOT ( col1 * + col2 ) NOT IN ( + col1 / col1 );
  - name: tab1

outputs:
  - name: q10451.out
    data: |
